  [],\n\t\"revision_timestamp\": \"2015-08-25T18:27:05.748617\",\n\t\"name\": \"amazon-web-services-downscaled-climate-projections-nex-dcp30\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The NASA Earth Exchange (NEX) Downscaled
  Climate Projections (NEX-DCP30) dataset is comprised of downscaled climate scenarios
  for the conterminous United States that are derived from the General Circulation
  Model (GCM) runs conducted under the Coupled Model Intercomparison Project Phase
  5 (CMIP5) [Taylor et al. 2012] and across the four greenhouse gas emissions scenarios
  known as Representative Concentration Pathways (RCPs) [Meinshausen et al. 2011]
  developed for the Fifth Assessment Report of the Intergovernmental Panel on Climate
  Change (IPCC AR5). The dataset includes downscaled projections from 33 models, as
  well as ensemble statistics calculated for each RCP from all model runs available.
  The purpose of these datasets is to provide a set of high resolution, bias-corrected
  climate change projections that can be used to evaluate climate change impacts on
  processes that are sensitive to finer-scale climate gradients and the effects of
  local topography on climate conditions. Each of the climate projections includes
  monthly averaged maximum temperature, minimum temperature, and precipitation for
  the periods from 1950 through 2005 (Retrospective Run) and from 2006 to 2099 (Prospective
  Run).\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
